import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCoffee } from '@fortawesome/free-solid-svg-icons'
import { Col, Row, Container } from "react-bootstrap";
import './LabelLayout.css'
import SportLabel from "./SportLabel";

const LabelLayout = () => {
    // LIST OF COLORS
    // "badge yellow"
    // "badge orange"
    // "badge pink"
    // "badge red"
    // "badge purple"
    // "badge teal"
    // "badge blue"
    // "badge blue-dark"
    // "badge green"
    // "badge green-dark"
    // "badge silver"
    // "badge gold"
    // "badge dark"
    // "badge red-dark"
    // "badge purple-dark"
    // "badge pink-dark"




    return(
        
        <Container id="label__layout">
            <Row id="label__row">
                <Col><SportLabel className= "badge purple-dark" symbol={<FontAwesomeIcon icon={faCoffee} size/>}  skillLevel="Recreational"/></Col>
                <Col><SportLabel className= "badge blue-dark" symbol={<img src="https://img.icons8.com/ios-filled/28/000000/cycling-road--v1.png" alt="cycling" style={{'marginTop':'5px'}}/>} skillLevel="Advanced"/></Col>
                <Col><SportLabel className= "badge green" symbol={<img src="https://img.icons8.com/ios-filled/25/000000/tennis.png" alt="tennis" style={{'marginTop':'7px'}}/>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge pink" symbol={<i className="fa fa-star"></i>} skillLevel="Intermediate"/></Col>
                <Col><SportLabel className= "badge teal" symbol={<img src="https://img.icons8.com/glyph-neue/28/000000/basketball.png" style={{'marginTop':'5px'}}/>} skillLevel="Beginner"/></Col>
            </Row>
            <Row id="label__row">
                <Col><SportLabel className= "badge green-dark" symbol={<i className="fa fa-star"></i>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge red" symbol={<i className="fa fa-star"></i>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge dark" symbol={<i className="fa fa-star"></i>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge red-dark" symbol={<i className="fa fa-star"></i>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge yellow" symbol={<i className="fa fa-star"></i>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge pink-dark" symbol={<i className="fa fa-star"></i>} skillLevel="Beginner"/></Col>
            </Row>
            <Row id="label__row">
                <Col><SportLabel className= "badge blue" symbol={<i className="fa fa-star"></i>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge purple" symbol={<i className="fa fa-star"></i>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge orange" symbol={<i className="fa fa-star"></i>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge gold" symbol={<i className="fa fa-star"></i>} skillLevel="Beginner"/></Col>
                <Col><SportLabel className= "badge silver" symbol={<i className="fa fa-star"></i>} skillLevel="Beginner"/></Col>
            </Row>
        </Container>
    )
    
}

export default LabelLayout;
